import React from 'react';
import '../App.css';

function Footer(){
    return(
    <div className="Footer">
        <section id="footer">
            <footer className = "mt-16 flex flex-col justify-center items-center">
                        This site was made by Tyler Rubin
                        <html><style> 
                        .link {{color: "#FF0000" }}
                        <center><a style={{color: "lightgreen", hover:"red"}} href="https://www.linkedin.com/in/tyler-rubin/">LinkedIn</a></center>
                        <center><a style={{color: "lightgreen"}} href="https://github.com/jabba67">Github</a></center>
                        </style></html>
            </footer>
        </section>
    </div>
    );
}
export default Footer;
